import React, { useEffect, useState } from 'react';
import axios from "axios";
import Ajout from './Ajout';
const Result = () => {

    const [document,setDocument]=useState([]);
    console.log("test");
    useEffect(()=>{
        axios.get("k/auteur").then((res)=>setDocument(res.data))
     
    },[])

    return (
        <div className="Result" align="center">
            <h1> Liste des resultat</h1>
            <div className="container">
                <div className="row">
                    <div className="p-2 col-2 border border-primary rounded" >
                    FILTRE
                    <br /><br />
                    <NavLink to="/Ajout"><button type="button" className="btn btn-outline-primary">Ajout de these</button></NavLink>
                    <br /> <br />           
                    <NavLink to="/"> <button type="button" className="btn btn-outline-primary">Gestion Utilisateur(Accueil)</button> </NavLink>
                    <br /><br />
                    <button type="button" className="btn btn-outline-primary">Gestion des theses</button>
                    <br /><br />
                    <button type="button" className="btn btn-outline-primary">Statistiques</button>

                    </div>
                    <div className=" border border-primary rounded col-10">
                    RESULTAT

                   
                  {document.map(doc=> 
                     <div className="card"  key={doc.id} >
                        <h5 className="card-header">{doc.auteur}</h5>
                         <div className="card-body">
                             <h5 className="card-title" >{doc.titre}</h5>
                             <p className="card-text">With supporting text below as a natural lead-in to additional content.</p>
                             <a href="#" className="btn btn-primary">Modifier</a>
                             <a href="#" className="btn btn-primary">Supprimer</a>
                             <a href="#" className="btn btn-primary">Go somewhere</a>
                         </div>
                     </div>
                    
                  )}

                  
                    </div>
                </div>
                </div>
             </div>
    );
};

export default Result;
